import { Box } from "@mui/material";
import MyTypography from "../../../components/MyTypography";

const footer = () =>{
    return(
        <Box sx={{padding:"64px 16px"}}>
            <Box sx={{ 
                display: 'flex',        // Establece el contenedor como un Flexbox
                alignItems: 'center',   // Alinea verticalmente los elementos (por si hay diferencia de altura)
                justifyContent: 'center', // Puedes usar 'space-between' o 'space-around' si quieres algo diferente
                width: '100%',
            }}>
                <MyTypography 
                    text="Powered by" 
                    size="18px"
                    letterSpacing="6px"
                    fontFamily="Raleway"
                    margin="10px 0"
                    fontWeight="400"
                    opacity="0.5"
                /> 
                <a color="#262626 !important" href="https://www.w3schools.com/w3css/default.asp">W3.CSS</a>
            </Box>
        </Box>
    );
}

export default footer;
